                <Link to="/editprofile" ><Button><i className="fas fa-user-circle text-primary"></i>{"   EDIT PROFILE"}</Button></Link>
                <Link to="/addeducation"><Button><i className="fas fa-graduation-cap text-primary"></i> {"   "}Add Education</Button></Link>
                <Link to="/myposts"><Button><i className="fas fa-graduation-cap text-primary"></i> {"   "}Manage My Articles</Button></Link>
            </div>
        </Fragment>
    )
}

export default dashboardactions;
